CREATE FUNCTION public.borrower_collections(current_month character varying, loan_no1 character varying, app_code character varying) RETURNS TABLE(serial_no1 numeric, loan_number1 character varying, emi_date1 date, cl_balance1 numeric, emi1 numeric, interest1 numeric, principal1 numeric, amount_received1 numeric, received_date1 timestamp with time zone, is_emi_amt_collected1 boolean, remarks1 character varying)
    LANGUAGE plpgsql
    AS $$
BEGIN
		RETURN QUERY SELECT l.serial_no, l.loan_number, l.emi_date, l.cl_balance, 
		l.emi, l.interest, l.principal, cl.amount_received, cl.received_date, l.is_emi_amt_collected, l.remarks
   		FROM lf_loan_sanction_calc l
		LEFT JOIN lf_loan_collections cl ON cl.loan_account_number = l.loan_number AND cl.emi_date=l.emi_date
   		WHERE l.emi_date <= current_month::date AND l.loan_number = loan_no1 AND l.application_code = app_code
		ORDER BY cl.received_date::date ASC;
END;
$$;


ALTER FUNCTION public.borrower_collections(current_month character varying, loan_no1 character varying, app_code character varying) OWNER TO live_lfipl;

