--
-- Name: save_application_income(character varying, character varying, character varying, numeric, numeric); Type: PROCEDURE; Schema: public; Owner: live_lfipl
--

CREATE PROCEDURE public.save_application_income(IN income_code1 character varying, IN application_code1 character varying, IN particulars_type_code1 character varying, IN daily_income1 numeric, IN monthly_income1 numeric)
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF EXISTS(SELECT income_id FROM lf_application_income_details 
			  WHERE lf_application_income_details.application_code = application_code1
			  AND lf_application_income_details.particulars_type_code=particulars_type_code1
			 ) 
	THEN
			 
		UPDATE lf_application_income_details 
		SET daily_income=daily_income1, monthly_income=monthly_income1 
		WHERE particulars_type_code=particulars_type_code1 AND application_code = application_code1;
			 
    ELSE
		VALUES(income_code1, application_code1, particulars_type_code1, daily_income1, monthly_income1);
    END IF;
END
$$;


ALTER PROCEDURE public.save_application_income(IN income_code1 character varying, IN application_code1 character varying, IN particulars_type_code1 character varying, IN daily_income1 numeric, IN monthly_income1 numeric) OWNER TO live_lfipl;

